const delayTime = backendData.delayTime;
const actualarrivalTime = backendData.actualarrivalTime;

if (delayTime > 0) {
  document.getElementById('flightStatus').textContent = `Your flight is delayed by ${delayTime} minutes and will reach at ${actualarrivalTime}`;
} else {
  document.getElementById('flightStatus').textContent = 'On time';
}
